import React from 'react';
import PropTypes from 'prop-types';

const User = ({ user, users }) => (
  <div>
    <h2>{users[user].name}</h2>
  </div>
);

User.propTypes = {
  users: PropTypes.checkPropTypes(),
  user: PropTypes.number.isRequired,
};

export default User;
